import PropTypes from "prop-types";

type StudentPropType={
    student: number[]
}

    export default function StudentMarks({student}:StudentPropType) : React.ReactElement{
        
  
  return (
    
    <>
    
     Marks: {student}  &nbsp; 
    </>
  );
}


StudentMarks.propTypes = {
    student: PropTypes.number
}
